/**
* Database script used for setup of Rhino unit testing. 
* This script uses data from the open-source "sample-database" project,
* which is available here: https://github.com/chriseaton/sample-database
**/

CREATE DATABASE rhino_test;
GO
USE rhino_test;

--Create table "Product".
CREATE TABLE [Product] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [Name] VARCHAR(512) NOT NULL, [ScanCode] VARCHAR(512), [Cost] FLOAT NOT NULL, [Price] FLOAT NOT NULL, [ImageURL] VARCHAR(512), [DateCreated] DATETIME NOT NULL, [DateUpdated] DATETIME, [DateDeleted] DATETIME)

--Create table "Address".
CREATE TABLE [Address] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [Line1] VARCHAR(512) NOT NULL, [Line2] VARCHAR(512), [City] VARCHAR(512), [PostalCode] VARCHAR(512), [StateProvince] VARCHAR(512), [Country] VARCHAR(512), [Latitude] FLOAT, [Longitude] FLOAT)

--Create table "Customer".
CREATE TABLE [Customer] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [FirstName] VARCHAR(512) NOT NULL, [LastName] VARCHAR(512) NOT NULL, [Suffix] VARCHAR(512), [CompanyName] VARCHAR(512), [Title] VARCHAR(512), [Notes] VARCHAR(512), [AccountNumber] FLOAT, [Photo] VARBINARY(MAX), [DateCreated] DATETIME NOT NULL, [DateUpdated] DATETIME, [DateDeleted] DATETIME)

--Create table "Order".
CREATE TABLE [Order] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [CustomerID] INT NOT NULL, [AddressID] INT NOT NULL, [Status] VARCHAR(512) NOT NULL, [PaymentMethod] VARCHAR(512), [Weight] FLOAT, [Shipped] BIT, [TrackingNumber] VARCHAR(512), [DateShipped] DATE, [TimeShipped] TIME)

--Create table "OrderProduct".
CREATE TABLE [OrderProduct] ([OrderID] INT NOT NULL, [ProductID] INT NOT NULL, [Quantity] INT NOT NULL, [UnitCost] FLOAT NOT NULL, [UnitPrice] FLOAT NOT NULL, [TotalCost] FLOAT NOT NULL, [TotalPrice] FLOAT NOT NULL)

--Create table "Role".
CREATE TABLE [Role] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [Name] VARCHAR(512) NOT NULL)

--Create table "User".
CREATE TABLE [User] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [RoleID] INT NOT NULL, [UserName] VARCHAR(512) NOT NULL, [Password] VARCHAR(512) NOT NULL, [DateCreated] DATETIME NOT NULL, [DateUpdated] DATETIME, [DateDeleted] DATETIME)

--Create table "Theme".
CREATE TABLE [Theme] ([ID] INT IDENTITY(1,1) PRIMARY KEY, [Name] VARCHAR(512) NOT NULL, [HexCode] VARCHAR(512) NOT NULL)

